import React from 'react';
import './Signup.css';

class SignUp extends React.Component  {
  render(){
      return (
          <div>
             
             <div class="container">
                 
                 <div class="col-xs-12 col-sm-12 col-md-12 col-lg-12">
                     <div className="bgLogin">
                        <h2 className="TextSignUp">ĐĂNG KÝ</h2>
                        <input type="text" class="form-control name" placeholder="Tên của bạn " />
                        <input type="text" class="form-control email" placeholder="Email hoặc số điện thoại" />
                        <input type="password" class="form-control pass" placeholder="Nhập mật khẩu" />
                        <input type="password" class="form-control passconfirm " placeholder="Nhập lại mật khẩu" />
                        
                        <button type="button" class="btn btn-default btnsignup">ĐĂNG KÝ</button>
                        <h5 style={{marginLeft:"380px",marginTop:"20px",paddingBottom:"10px",color:" aliceblue",fontFamily:"cursive"}}>
                            Bạn đã có tài khoản? &nbsp;
                            <a href="#" style={{fontFamily:"'Times New Roman', Times, serif",color:"aliceblue",fontSize:"20px"}}>Đăng nhập ngay !</a>
                        </h5>
                        
                     </div>
                 </div>
                 
             </div>
             
          </div>
    
  );
}
}
export default SignUp;
